import{_ as e,o as a,c as t,O as n}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 37.2-716 Behavioral Health and Developmental Services Revenue Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/37.2-716.md","filePath":"vacode/37.2-716.md"}'),r={name:"vacode/37.2-716.md"},l=n('<h1 id="§-37-2-716-behavioral-health-and-developmental-services-revenue-fund" tabindex="-1">§ 37.2-716 Behavioral Health and Developmental Services Revenue Fund. <a class="header-anchor" href="#§-37-2-716-behavioral-health-and-developmental-services-revenue-fund" aria-label="Permalink to &quot;§ 37.2-716 Behavioral Health and Developmental Services Revenue Fund.&quot;">​</a></h1><p>All funds collected by the Department pursuant to this article shall be paid into a special fund of the state treasury that shall be known and referred to as the Behavioral Health and Developmental Services Revenue Fund.</p><p>This fund shall be appropriated and used for the operation of the Department and its state facilities for research and training. Unexpended funds in the Behavioral Health and Developmental Services Revenue Fund at the close of any fiscal year shall be retained in the fund and be available for expenditure in ensuing years as provided herein.</p><p>Code 1950, § 37-125.2; 1950, p. 917; 1968, c. 477, § 37.1-106; 1970, c. 758; 1976, c. 671; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0716" target="_blank" rel="noreferrer">716</a>; 2009, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0813" target="_blank" rel="noreferrer">813</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0840" target="_blank" rel="noreferrer">840</a>.</p>',4),i=[l];function o(s,d,h,c,p,v){return a(),t("div",null,i)}const _=e(r,[["render",o]]);export{f as __pageData,_ as default};
